import React from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";

function Signin() {
  let navigate = useNavigate();
  let onClickHandler = () => {
    navigate("1");
  };
  return (
    <div>
      <div>회원가입 page.</div>
      <Link to="">1</Link>
      <button onClick={onClickHandler}>2</button>
    </div>
  );
}

export default Signin;
